import React from 'react'
import { AppBar, Toolbar, IconButton, Typography, ButtonGroup, Button, Stack, styled , Box} from '@mui/material'

import MenuIcon from '@mui/icons-material/Menu';
import { margin } from '@mui/system';

const navbar = () => {





    const buttons = [
        <Button key="Projects">One</Button>,
        <Button key="two">Two</Button>,
        <Button key="three">Three</Button>,
    ];

    return (
        <Box sx={{
            flexGrow: 1
        }}>

            <AppBar position="fixed" color = "transparent">
                <Toolbar variant="dense">

                    <Typography variant="h4" color="inherit" component="div" sx={{
                        flexGrow: 1,
                        margin: 2
                    }}>
                        Ezekiel Norman
                    </Typography>


                    <ButtonGroup color="secondary" size="large" aria-label="large button group" sx={{
                        alignContent:"flex-end"
                    }}>
                        {buttons}
                    </ButtonGroup>
                </Toolbar>

            </AppBar>
        </Box>
    )
}

export default navbar
